use std::{borrow::Borrow, cmp, collections::HashMap, time::Instant};

use itertools::Itertools;
use nalgebra::{Const, Dynamic, Matrix, OVector, SMatrix, VecStorage, Vector4};
use rayon::prelude::*;
use std::str::FromStr;
use strum::{EnumIter, EnumString, IntoEnumIterator, ParseError};

pub type PwmMatrix<T> = Matrix<T, Dynamic, Const<4>, VecStorage<T, Dynamic, Const<4>>>;

#[derive(Debug, EnumIter, Clone, Copy, EnumString, Hash, Eq, PartialEq)]
pub enum Base {
    A = 0,
    C = 1,
    G = 2,
    T = 3,
}

impl Base {
    pub fn complement(self) -> Base {
        match self {
            Base::A => Base::T,
            Base::C => Base::G,
            Base::G => Base::C,
            Base::T => Base::A,
        }
    }

    pub fn parse(seq: &str) -> Result<Vec<Base>, ParseError> {
        seq.chars()
            .map(|c| Base::from_str(&c.to_string()))
            .collect()
    }
}

pub struct ReturnValue {
    /// From "true" strand
    pos: usize,
    /// false: reverse complement
    /// true: normal
    strand: bool,
    css: f32,
    mss: f32,
}

// transcription factor prediction
// https://academic.oup.com/nar/article/31/13/3576/2904207
// https://meme-suite.org/meme/doc/transfac-format.html
// https://meme-suite.org/meme/meme_5.4.1/doc/fasta-format.html
fn match_alg(
    mut pwm: PwmMatrix<f32>,
    core_threshold: f32,
    matrix_threshold: f32,
    bases: Vec<Base>,
) -> ReturnValue {
    let pwm_nrows = pwm.nrows();
    let one = SMatrix::<f32, 1, 4>::repeat(1.0);
    pwm.row_iter_mut()
        .map(|mut r| {
            r *= 100.0;
            r += one;
            r /= r.sum();
        })
        .for_each(drop);

    let ppm = pwm;
    println!("PPM: {ppm}");

    let mut iv = ppm.clone();
    iv.iter_mut()
        .map(|c| *c = *c * (4.0 * *c).ln())
        .for_each(drop);
    let iv = iv.column_sum();
    println!("Column sum: {iv}");

    let iv_min: f32 = iv
        .row_iter()
        .zip(ppm.row_iter().map(|r| r.min()))
        .map(|(r, min)| r.sum() * min)
        .sum();
    let iv_max: f32 = iv
        .row_iter()
        .zip(ppm.row_iter().map(|r| r.max()))
        .map(|(r, max)| r.sum() * max)
        .sum();
    println!("After min_mul: {iv_min}");
    println!("After max_mul: {iv_max}");

    let column_max: Vec<_> = ppm
        .row_iter()
        .zip(iv.iter())
        .map(|(r, iv)| iv * r.iter().max_by(|l, r| l.partial_cmp(r).unwrap()).unwrap())
        .collect();
    let (core_start_index, core_max) = column_max
        .as_slice()
        .windows(5)
        .map(|a| a.iter().sum::<f32>())
        .enumerate()
        .max_by(|(_, l), (_, r)| l.partial_cmp(r).unwrap())
        .unwrap();
    println!("Max: {core_max}, @: {core_start_index}");

    let core = ppm.rows(core_start_index, 5);
    let core_iv = iv.rows(core_start_index, 5);
    println!("Core: {core}");
    println!("IV Core: {core_iv}");

    let core_min: f32 = core
        .row_iter()
        .zip(core_iv.iter())
        .map(|(r, iv)| iv * r.iter().min_by(|l, r| l.partial_cmp(r).unwrap()).unwrap())
        .sum();
    println!("Min: {core_min}");

    let products: HashMap<(Base, Base, Base, Base, Base), f32> = Base::iter()
        .cartesian_product(Base::iter())
        .cartesian_product(Base::iter())
        .cartesian_product(Base::iter())
        .cartesian_product(Base::iter())
        .map(|((((a, b), c), d), e)| {
            let current = core[(0, a as usize)] * core_iv[0]
                + core[(1, b as usize)] * core_iv[1]
                + core[(2, c as usize)] * core_iv[2]
                + core[(3, d as usize)] * core_iv[3]
                + core[(4, e as usize)] * core_iv[4];
            (
                (a, b, c, d, e),
                (current - core_min) / (core_max - core_min),
            )
        })
        .collect();

    let significant_bases = bases
        .as_slice()
        .windows(5)
        .enumerate()
        .skip(core_start_index)
        .take(bases.len() - core_start_index - (pwm_nrows - core_start_index - 5))
        .map(|(i, s)| (i, products[&(s[0], s[1], s[2], s[3], s[4])]))
        .filter(|(_, css)| css >= &core_threshold);
    println!(
        "Significant Bases(Core) {:?}",
        significant_bases.clone().collect::<Vec<_>>()
    );

    let significant_bases = significant_bases
        .map(|(sig_index, _)| {
            let current: f32 = ppm
                .row_iter()
                .zip(iv.iter())
                .zip(bases.iter().skip(sig_index - core_start_index))
                .map(|((r, iv), b)| iv * r[(0, *b as usize)])
                .sum();
            (sig_index, (current - iv_min) / (iv_max - iv_min))
        })
        .filter(|(_, mss)| mss >= &matrix_threshold);
    println!(
        "Significant Bases(Matrix) {:?}",
        significant_bases.clone().collect::<Vec<_>>()
    );

    todo!("")
}

